import {
	Button,
	Dialog,
	IconButton,
	MenuItem,
	Select,
	Stack,
	TextField,
	Typography,
} from "@mui/material";
import React, { useState } from "react";

const CustomSearchDialog = ({ breeds, open, handleClose }) => {
	const [selectedBreed, setSelectedBreed] = useState();
	const [number, setNumber] = useState();
	const [images, setImage] = useState([]);

	const handleSelect = (e) => {
		setSelectedBreed(e.target.value);
	};
	const handleChange = (e) => {
		setNumber(e.target.value);
	};

	const getImages = () => {
		fetch(`https://dog.ceo/api/breed/${selectedBreed}/images/random/${number} `)
			.then((res) => res.json())
			.then((data) => setImage(data.message));
	};

	return (
		<Dialog open={open} onClose={handleClose}>
			<Stack direction="row" alignItems="center" justifyContent="space-between">
				<Typography>Custom Search</Typography>
				<IconButton onClick={handleClose}>X</IconButton>
			</Stack>
			<Stack direction="row" alignItems="center" justifyContent="space-between">
				<Select onChange={handleSelect} value={selectedBreed} size="small">
					{breeds.map((breed) => (
						<MenuItem value={breed}>{breed}</MenuItem>
					))}
				</Select>
				<TextField type="number" size="small" onChange={handleChange} />
			</Stack>
			<Button
				sx={{
					color: "white",
					backgroundColor: "green",
				}}
				variant="contained"
				onClick={getImages}
				disabled={!selectedBreed || !number}
			>
				Get Images
			</Button>
			{images.map((image) => (
				<Stack
					sx={{ width: "120px", height: "120px" }}
					direction="column"
					alignItems="center"
					justifyContent="center"
				>
					<img style={{ width: "120px", height: "120px" }} src={image} />
				</Stack>
			))}
		</Dialog>
	);
};

export default CustomSearchDialog;
